// src/utils/highcharts-config.js
import Highcharts from 'highcharts';

import ExportingModule from 'highcharts/modules/exporting';
import AccessibilityModule from 'highcharts/modules/accessibility';
import DrilldownModule from 'highcharts/modules/drilldown';
import OfflineExporting from 'highcharts/modules/offline-exporting';
import AnnotationsModule from 'highcharts/modules/annotations';

const modules = [
  { name: 'ExportingModule', mod: ExportingModule },
  { name: 'AccessibilityModule', mod: AccessibilityModule },
  { name: 'DrilldownModule', mod: DrilldownModule },
  { name: 'OfflineExporting', mod: OfflineExporting },
  { name: 'AnnotationsModule', mod: AnnotationsModule },
];

modules.forEach(({ name, mod }) => {
  try {
    const fn = mod.default || mod;
    if (typeof fn === 'function') {
      fn(Highcharts);
      console.log(`${name} initialized`);
    } else {
      console.warn(`${name} is not a function`);
    }
  } catch (err) {
    console.error(`Error loading ${name}:`, err);
  }
});

export default Highcharts;
